import { useState, useEffect } from "react";


const ContactList = () => {
    const [data,setData] = useState()
    useEffect(() => {
        fetch('http://localhost:3030/contacts')
        .then(res => {
            return res.json()
        })
        .then(contacts => {
            setData(contacts)
        })
    })

    return(
        <div className="contactList">
            { data.map((contact) => {
                <div className="contact" key={contact.id}>
                    <h2>{ contact.name }</h2>
                </div>
            })}
        </div> 
    )
}
export default ContactList
